												dataViews.push({id:"b6811261-01b1-4f92-b4ef-12c8cf959aa0", type:"ArchimateDiagramModel", name:decodeURL("Accounting"), documentation:decodeURL("Central+to+the+idea+of+the+smart+government+is+%28near%29+real-time+access+to+detailed+ledger+transactions+or+aggregated+ledger+reports.%0D%0A%0D%0AThe+relationships+between+the+ERP-application%2C+accounting+function+and+ledger+services+are+just+basic+definitions+of+services+and+interfaces+without+many+assumptions+being+made.%0D%0A%0D%0AThe+diagram+shows+an+accountant+role+providing+an+accounting-service+to+the+SME+through+the+accounting-function+of+an+ERP-system.+The+SME+might+do+the+accounting+inhouse%2C+but+with+increased+requirements+for+integration+across+enterprises+and+public+agencies+it+seems+reasonable+to+assume+that+a+decreasing+number+of+companies+will+choose+this+option.%0D%0A%0D%0AAlso%2C+with+increased+integration+of+structured+data+across+the+entire+value+chain%2C+the+need+for+an+accountant+role+might+vanish+completely.+The+need+for+external+audit+will+probably+still+be+needed%2C+but+with+increased+integration+and+automation%2C+it+might+be+replaced+by+automatic+audits+by+government+agencies+such+as+tax+authorities.%0D%0A%0D%0AThe+external+stakeholders+are+mostly+from+the+stakeholder+analysis.+Neither+this+nor+the+business+case+are+specific+on+which+use+cases+are+considered+or+which+data+the+different+stakeholders+might+be+interrested+in%2C+but+the+connections+in+the+model+list+some+assumed+use-cases+which+seem+reasonable.+Please+also+see+the+%22analysis%22+and+%22credit+lending%22+views+for+more+stakeholder+relationships.%0D%0A%0D%0AThere+is+a+distinction+between+the+services+%22ledger+details%22+and+%22ledger+aggregation%22+to+be+able+to+show+which+stakeholders+would+have+access+to+which+level+of+detail.+The+business+itself+will+probably+want+to+control+which+stakeholders+have+access+to+which+details.+A+typical+example+would+be+that+media+would+probably+like+to+have+access+to+all+details%2C+while+the+business+only+want+to+show+aggregated+reports.%0D%0A%0D%0AThe+ledger+details+might+also+reveal+personally+identifiable+information%2C+especially+when+correlated+with+other+sources.+So+the+privacy+implications+of+these+services+needs+to+be+considered+carefully+and+appropriate+access+control+needs+to+be+implemented.%0D%0A")});
